import React from "react";
import "./Header.scss";

function Header() {
  return (
    <div className="header">
      <img
        className="header__logo"
        src="%PUBLIC_URL%/Logo_ML@2x.png.png"
        alt="Amazon Clone Logo"
      />
    </div>
  );
}

export default Header;
